import React, { useState } from "react";

const Checkout = () => {
  // get user info from local storage
  const userInfo = JSON.parse(localStorage.getItem("user")) || {};
  const [firstName, setFirstName] = useState(userInfo.firstName || "");
  const [lastName, setLastName] = useState(userInfo.lastName || "");
  const [street, setStreet] = useState(userInfo.street || "");
  const [houseNumber, setHouseNumber] = useState(userInfo.houseNumber || "");
  const [postalCode, setPostalCode] = useState(userInfo.postalCode || "");
  const [city, setCity] = useState(userInfo.city || "");
  const [country, setCountry] = useState(userInfo.country || "");
  const [email, setEmail] = useState(userInfo.email || "");
  const [phone, setPhone] = useState(userInfo.phone || "");
  // const [loading, setLoading] = useState(true);

  const handleCheckoutChange = (event) => {
    const { id, value } = event.target;
    if (id === "firstName") {
      setFirstName(value);
    } else if (id === "lastName") {
      setLastName(value);
    } else if (id === "street") {
      setStreet(value);
    } else if (id === "houseNumber") {
      setHouseNumber(value);
    } else if (id === "postalCode") {
      setPostalCode(value);
    } else if (id === "city") {
      setCity(value);
    } else if (id === "country") {
      setCountry(value);
    } else if (id === "email") {
      setEmail(value);
    } else if (id === "phone") {
      setPhone(value);
    } else {
      console.log("No id found");
    }
  };

  return (
    <div className="checkout-container">
      <h2>Checkout</h2>
      <div className="checkout-form">
        <form>
          <div className="form-group">
            <label htmlFor="firstName">First Name</label>
            <input
              type="text"
              className="form-control"
              id="firstName"
              placeholder="First Name"
            />
          </div>
          <div className="form-group">
            <label htmlFor="lastName">Last Name</label>
            <input
              type="text"
              className="form-control"
              id="lastName"
              placeholder="Last Name"
            />
          </div>
          <div className="form-group">
            <label htmlFor="street">Street</label>
            <input
              type="text"
              className="form-control"
              id="street"
              placeholder="Street"
            />
          </div>
          <div className="form-group">
            <label htmlFor="houseNumber">House Number</label>
            <input
              type="text"
              className="form-control"
              id="houseNumber"
              placeholder="House Number"
            />
          </div>
          <div className="form-group">
            <label htmlFor="postalCode">Postal Code</label>
            <input
              type="text"
              className="form-control"
              id="postalCode"
              placeholder="Postal Code"
            />
          </div>
          <div className="form-group">
            <label htmlFor="city">City</label>
            <input
              type="text"
              className="form-control"
              id="city"
              placeholder="City"
            />
          </div>
          <div className="form-group">
            <label htmlFor="country">Country</label>
            <input
              type="text"
              className="form-control"
              id="country"
              placeholder="Country"
            />
          </div>
          <div className="form-group">
            <label htmlFor="phoneNumber">Phone Number</label>
            <input
              type="text"
              className="form-control"
              id="phoneNumber"
              placeholder="Phone Number"
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email Address</label>
            <input
              type="text"
              className="form-control"
              id="email"
              placeholder="Email Address"
            />
          </div>
          <div className="form-group">
            <label htmlFor="paymentMethod">Payment Method</label>
            <select className="form-control" id="paymentMethod">
              <option>Credit Card</option>
              <option>PayPal</option>
              <option>Bank Transfer</option>
            </select>
          </div>
          <div className="form-group">
            <label htmlFor="creditCardNumber">Credit Card Number</label>
            <input
              type="text"
              className="form-control"
              id="creditCardNumber"
              placeholder="Credit Card Number"
            />
          </div>
          <div className="form-group">
            <label htmlFor="creditCardExpirationDate">
              Credit Card Expiration Date
            </label>
            <input
              type="text"
              className="form-control"
              id="creditCardExpirationDate"
              placeholder="Credit Card Expiration Date"
            />
          </div>
          <div className="form-group">
            <label htmlFor="creditCardSecurityCode">
              Credit Card Security Code
            </label>
            <input
              type="text"
              className="form-control"
              id="creditCardSecurityCode"
              placeholder="Credit Card Security Code"
            />
          </div>
        </form>
      </div>
    </div>
  );
};

export default Checkout;
